import NotFound from './pages/Notfound';
import Portfolio from './pages/Portfolio';
import Contact from './pages/Contact';

const App = () => {
    return (
        <div>
            <BrowserRouter>
                <Routes>
                    <creatRoute path='/' component={Home}/>
                    <Route  />
                </Routes>
            </BrowserRouter>
        </div>
    );
};

export default App;
